#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
                         `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
                         `email` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
                         `phone` bigint(20) NOT NULL,
                         `pass_hash` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
                         `created_at` datetime NOT NULL DEFAULT current_timestamp(),
                         `can_comment` tinyint(1) DEFAULT NULL,
                         `who_can_view` enum('all','friends_of_friends','friends','me') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'all',
                         `who_can_message` enum('all','friends_of_friends','friends','me') COLLATE utf8_unicode_ci DEFAULT 'all',
                         `who_can_invite` enum('all','friends_of_friends','friends','me') COLLATE utf8_unicode_ci DEFAULT 'all',
                         `updated_at` datetime DEFAULT NULL,
                         PRIMARY KEY (`id`),
                         UNIQUE KEY `id` (`id`),
                         UNIQUE KEY `users_email_index` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
                            `id` bigint(20) unsigned NOT NULL,
                            `name` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
                            `surname` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
                            `gender` varchar(1) COLLATE utf8_unicode_ci NOT NULL,
                            `birthday` date DEFAULT NULL,
                            `avatar_id` bigint(20) DEFAULT NULL,
                            PRIMARY KEY (`id`),
                            CONSTRAINT `profiles_users_id_fk` FOREIGN KEY (`id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: friend_requests
#

DROP TABLE IF EXISTS `friend_requests`;

CREATE TABLE `friend_requests` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `from_user_id` bigint(20) unsigned NOT NULL,
  `to_user_id` bigint(20) unsigned NOT NULL,
  `status` enum('send','approved','declined','denied') COLLATE utf8_unicode_ci DEFAULT 'send',
  `sent_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`from_user_id`,`to_user_id`),
  UNIQUE KEY `id` (`id`),
  KEY `friend_requests_profiles_id_fk_2` (`to_user_id`),
  CONSTRAINT `friend_requests_profiles_id_fk` FOREIGN KEY (`from_user_id`) REFERENCES `profiles` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `friend_requests_profiles_id_fk_2` FOREIGN KEY (`to_user_id`) REFERENCES `profiles` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `from_user_id` bigint(20) unsigned NOT NULL,
  `to_user_id` bigint(20) unsigned NOT NULL,
  `content` text COLLATE utf8_unicode_ci NOT NULL,
  `send_at` datetime NOT NULL DEFAULT current_timestamp(),
  `change_at` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `changed` tinyint(1) DEFAULT 0,
  UNIQUE KEY `id` (`id`),
  KEY `messages_profiles_id_fk` (`from_user_id`),
  KEY `messages_profiles_id_fk_2` (`to_user_id`),
  CONSTRAINT `messages_profiles_id_fk` FOREIGN KEY (`from_user_id`) REFERENCES `profiles` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `messages_profiles_id_fk_2` FOREIGN KEY (`to_user_id`) REFERENCES `profiles` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



